import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import s from "../services/tutorial.service";

class User extends Component {

  componentDidMount() {
    s.getAll()
      .then(res => {
        const api = res.data;
        this.setState({ api });
      })
  }


  render() {
    return (<h1>Paulo</h1>);
  }
}

export default User;
